import React, {useEffect, useState} from 'react'

const LeaderBoard = () => {
    const [players, setPlayers] = useState([]);
    const [queens, setQueens] = useState([]);

    useEffect(() => {
        fetch('http://localhost:9000/api/queens', {
            method: 'GET'
        })
        .then(res => res.json()
        .then(queensList => {
            setQueens(queensList);
            fetch('http://localhost:9000/api/players', {
                method: 'GET'
            })
            .then(res => res.json()
            .then(playersList => setPlayers(playersList))
            )
        })
        )
        .catch(err => console.log(err));
    }, [])

    return (
        <div>
            {players.map((player, idx) => {
                return (
                    <div className="ldbPlayer" key={player.player_id}>
                        <h2>{player.player_name}</h2>
                        <p>{player.player_points}</p>
                    </div>
                )
            })}
        </div>
    )
}

export default LeaderBoard
